import React from "react";
import ContentLoader from "react-content-loader";
import DataTableLoader from "./DataTableLoader";

export const OccupiedTableLoader = (props) => (
    <ContentLoader
        speed={2}
        viewBox="0 0 400 200"
        backgroundColor="#f3f3f3"
        foregroundColor="#ecebeb"
        style={{ width: "100%" }}
        {...props}
    >
        <rect x="0" y="0" rx="3" ry="3" width="400" height="160" />
    </ContentLoader>
);

export const FreeTableLoader = (props) => (
    <ContentLoader
        speed={2}
        style={{ width: "100%", height: "60px" }}
        viewBox="0 0 200 40"
        backgroundColor="#f3f3f3"
        foregroundColor="#ecebeb"
        {...props}
    >
        <rect x="0" y="0" rx="3" ry="3" width="100%" height="100%" />
    </ContentLoader>
);

export const SkeletonBoxes = () => {
    let tableSkeleton = [];
    for (let i = 0; i < 4; i++) {
        tableSkeleton.push(
            <div className="col-lg-3 col-6" key={i}>
                <OccupiedTableLoader />{" "}
            </div>
        );
    }
    return tableSkeleton;
};

export const SkeletonSales = () => {
    return (
        <div className="row">
            <div className="col-12 col-lg-6">
                <div className="card">
                    <div className="card-body">
                        <DataTableLoader />
                    </div>
                </div>
            </div>
            <div className="col-12 col-lg-6">
                <div className="card">
                    <div className="card-body">
                        <DataTableLoader />
                    </div>
                </div>
            </div>
        </div>
    );
};
